//import '../styles/components/Header.scss';
import logo from '../images/logo.png';
const Header = (props) => {
  const openBurger = document.querySelector('.js-open_burger');
  const closeBurger = document.querySelector('.js-close_burger');
  const headerNav = document.querySelector('.js-header_nav');

  function handleOpenBurger() {
    headerNav.classList.add('visible');
  }
  openBurger.addEventListener('click', handleOpenBurger);
  return (
    <>
      <header className="header">
        <a href="https://github.com/mhidalgoma">
          <img className="header__logo" src={logo} alt="Calenpet logo" />
        </a>
        <div className="header__burger js-open_burger">
          <i class="fa-solid fa-bars"></i>
        </div>
        <nav className="header__nav js-header_nav">
          <div className="header__nav--close js-close_burger">
            <i class="fa-solid fa-xmark"></i>
          </div>
          <ul className="header__nav--list">
            <li className="header__nav--list-item">
              <a href="https://github.com/mhidalgoma">¿Qué es CalenPet?</a>
            </li>
            <li className="header__nav--list-item">
              <a href="https://github.com/mhidalgoma"> Cómo usar CalenPet</a>
            </li>
            <li className="header__nav--list-item">
              <a href="https://github.com/mhidalgoma"> Sobre nosotros</a>
            </li>
            <li className="header__nav--list-item">
              <a href="https://github.com/mhidalgoma">Contacto</a>
            </li>
          </ul>
        </nav>
      </header>
    </>
  );
};
export default Header;
